('get_schedule_enter_email','ar',' احصل على جدول زمني لجميع التطعيمات الموصى بها من قبل <WHO_LINK_START&&> منظمة الصحة العالمية لبلدكم وتذكير عبر البريد الإلكتروني مجانا قبل أسبوعين من كل التطعيم. سيتم استخدام البريد الإلكتروني الخاص بك فقط للتذكير بالتطعيم. نحن لا نشارك عناوين البريد الإلكتروني مع أي طرف خارجي.'),('get_schedule_enter_email','bg','Получете график за всички ваксинации, препоръчани от <WHO_LINK_START&&>WHO<WHO_LINK_END&&> за вашата страна, както и безплатно напомняне по имейл две седмици преди всяка ваксинация. Вашият имейл ще бъде използван само за напомняния за ваксиниране. Не споделяме имейл адреси с външни лица.'),('get_schedule_enter_email','bn','আপনার দেশের জন্য <WHO_LINK_START&&>WHO<WHO_LINK_END&&> কর্তৃক প্রস্তাবিত সমস্ত টিকাদানের একটি সময়সূচী এবং প্রতিটি টিকাদানের দুই সপ্তাহ আগে বিনামূল্যে ইমেইল রিমাইন্ডার পান। আপনার ইমেইল শুধুমাত্র টিকাদানের সময় অবহিত করার প্রয়োজনে ব্যবহৃত হবে। আমরা বাইরের কোন পক্ষের সাথে ইমেইল অ্যাড্রেস শেয়ার করিনা।'),('get_schedule_enter_email','ca','Obté un calendari de totes les vacunes recomanades per la <WHO_LINK_START&&>OMS<WHO_LINK_END&&> per al teu país i un recordatori per correu electrònic gratuït dues setmanes abans de cada vacunació. El teu correu electrònic només s\'utilitzarà per recordatoris de vacunació. No compartim adreces de correu electrònic amb ningú.'),('get_schedule_enter_email','cs','Získejte časový rozpis všech očkování doporučených <WHO_LINK_START&&>WHO<WHO_LINK_END&&> pro vaši zemi a emailové připomínky zdarma dva týdny před každým očkováním. Email je použit pouze pro připomínky vakcinací. Nebude sdílen.'),('get_schedule_enter_email','da','Få en plan for alle vaccinationerne anbefalet af <WHO_LINK_START&&>WHO<WHO_LINK_END&&>  for dit land, og en gratis e-mail påmindelse to uger før hver vaccination. Din e-mail vil udelukkende blive brugt til vaccinationspåmindelser. Vi deller ikke din e-mailadresse med nogen udenforstående. '),('get_schedule_enter_email','de','Erhalten Sie einen Zeitplan für alle Impfungen, die von <WHO_LINK_START &&> WHO <WHO_LINK_END &&> für Ihr Land empfohlen werden, und eine kostenlose E-Mail-Erinnerung zwei Wochen vor jeder Impfung. Die E-Mail wird nur für Impfungen verwendet und  nicht geteilt.'),('get_schedule_enter_email','el','Λήψη προγράμματος όλων των εμβολιασμών που προτείνει ο <WHO_LINK_START&&>ΠΟΥ<WHO_LINK_END&&> για την χώρα σου και λήψη δωρεάν email υπενθύμισης δυο εβδομάδες πριν κάθε προγραμματισμένο εμβολιασμό. Το email σου θα χρησιμοποιηθεί μόνο για την λήψη υπενθυμίσεων εμβολιασμού. Δε μοιραζόμαστε τις email διευθύνσεις με εξωτερικά τρίτα μέρη.'),('get_schedule_enter_email','en','Get a schedule of all vaccinations recommended by the <WHO_LINK_START&&>WHO<WHO_LINK_END&&> for your country and a free email reminder two weeks before each vaccination. Your email will be used only for vaccination reminders. We do not share email addresses with any outside party.'),('get_schedule_enter_email','es','Consigue un calendario de vacunas de la <WHO_LINK_START&&>OMS<WHO_LINK_END&&> recomendadas en tu país y un recordatorio por correo electrónico 2 semanas antes de cada vacuna de forma gratuita. Tu email se usará sólo para recordarte las vacunas. No compartimos las direcciones de correo con terceros. '),('get_schedule_enter_email','fa','برنامه تمامی واکسینهای پیشنهاد شده توسط سازمان سلامت جهان <&&WHO_LINK_START&&> WHO <WHO_LINK_END> را برای کشورتان، به همراه ایمیل یاد آور (که دو هفته قبل از هر واکسن به شما فرستاده خواهد شد)، دریافت نمایید. ایمیل شما فقط جهت یادآور واکسن استفاده خواهد شد. ما هیچ ایمیلی را با اشخاص ثالث به اشتراک نمی گذاریم.'),('get_schedule_enter_email','fi','Hanki lista kaikista <WHO_LINK_START&&>WHO<WHO_LINK_END&&> :n maassasi suosittelemista rokotuksista ja ilmainen muistutus sähköpostiin kaksi viikkoa ennen jokaista rokotusta. Sähköpostiosoitettasi käytetään ainoastaan muistutusten lähettämiseen. Emme jaa sähköpostiosoitteita ulkopuolisten tahojen kanssa.'),('get_schedule_enter_email','fr','Obtenez un calendrier de tous les vaccins recommandés par <WHO_LINK_START &&> WHO <WHO_LINK_END &&> pour votre pays et un rappel par e-mail gratuit deux semaines avant chaque vaccination. Votre courriel ne sera utilisé que pour les rappels de vaccination. Nous ne partageons pas d\'adresses e-mail avec des tiers.'),('get_schedule_enter_email','gu','દ્વારા ભલામણ તમામ રસીકરણ એક શેડ્યૂલ મેળવો \n<કોણ_લિંક્સ_શરૂઆત &&> કોણ <કોણ_લિંક્સ_અંત &&> તમારા દેશ માટે અને એક મફત ઇમેઇલ સ્મૃતિપત્ર દરેક રસીકરણના બે અઠવાડિયા પહેલાં તમારું ઇમેઇલ ફક્ત રસીકરણ રીમાઇન્ડર્સ માટે જ વપરાશે. અમે કોઈપણ બહારના પક્ષ સાથે ઇમેઇલ સરનામાં શેર કરતા નથી.'),('get_schedule_enter_email','he','קבל לו\"ז של כל החיסונים המומלצים על ידי <&&WHO_LINK_START>ארגון הבריאות העולמי<&&WHO_LINK_END> עבור המדינה שלך והתראה של שבועיים מראש במייל בחינם לפני כל חיסון. מייל המשמש עבור התראות חיסונים בלבד. מייל ישאר פרטי.'),('get_schedule_enter_email','hi','आपके देश के लिए <WHO_LINK_START &&> WHO <WHO_LINK_END &&> द्वारा अनुशंसित सभी टीकों के शिड्यूल और प्रत्येक टीके से दो सप्ताह पहले एक निःशुल्क ईमेल रिमाइंडर प्राप्त करें। आपका ईमेल केवल टीकाकरण अनुस्मारक के लिए उपयोग किया जाएगा। हम किसी भी बाहरी पार्टी के साथ ईमेल पते साझा नहीं करते हैं।'),('get_schedule_enter_email','hr','Nabavite raspored svih cijepljenja koja <WHO_LINK_START&&>SZO<WHO_LINK_END&&> preporučuje za vašu zemlju i besplatan podsjetnik e-mailom dva tjedna prije svakog cijepljenja. Vaš će se e-mail upotrebljavati samo za podsjetnike na cijepljenje. Ne dijelimo e-mail adrese s bilo kojom vanjskom strankom.	'),('get_schedule_enter_email','hu','Kérjen ütemtervet az összes <WHO_LINK_START&&>WHO<WHO_LINK_END&&> által az országában javasolt védőoltásról és egy ingyenes e-mailes emlékeztetőt két héttel minden oltás előtt. Az e-mail címet csak az oltási emlékeztetőkhöz használjuk fel. Nem osztjuk meg.'),('get_schedule_enter_email','it','Ottieni un programma di tutte le vaccinazioni consigliate dal <WHO_LINK_START &&> WHO <WHO_LINK_END &&> per il tuo paese e un promemoria via email due settimane prima di ogni vaccinazione. La tua email verrà utilizzata solo per i promemoria delle vaccinazioni. Non condividiamo gli indirizzi email con nessuna parte esterna.'),('get_schedule_enter_email','ja','あなたの国の<WHO_LINK_START&&>WHO <WHO_LINK_END&&>が推奨するすべてのワクチン接種のスケジュールを入手し、各ワクチン接種の2週間前に無料のEメールリマインダーを入手してください。メールアドレスはワクチン接種のリマインダにのみ使用されます。あなたのメールアドレスを外部の人と共有することはありません。'),('get_schedule_enter_email','ka','ನಿಮ್ಮ ದೇಶಕ್ಕೆ <WHO_LINK_START&&>ವಿಶ್ವ ಆರೋಗ್ಯ ಸಂಸ್ಥೆ<WHO_LINK_END&&> ಸೂಚಿಸಿರುವ ಎಲ್ಲಾ ಲಸಿಕೆಗಳ ವೇಳಾಪಟ್ಟಿ ಮತ್ತು ಪ್ರತಿ ಲಸಿಕೆ ಹಾಕಿಸಬೇಕಾದ ದಿನದ ಎರಡು ವಾರ ಮೊದಲು ಉಚಿತ ಇಮೇಲ್ ಜ್ಞಾಪನೆಯನ್ನು ಪಡೆಯಿರಿ. ಲಸಿಕೆ ಜ್ಞಾಪನೆಗಳಿಗಾಗಿ ಮಾತ್ರ ನಿಮ್ಮ ಇಮೇಲ್ ಅನ್ನು ಬಳಸಲಾಗುತ್ತದೆ. ಯಾವುದೇ ಹೊರಗಿನ ವ್ಯಕ್ತಿಯೊಂದಿಗೆ ನಾವು ಇಮೇಲ್ ವಿಳಾಸಗಳನ್ನು ಹಂಚಿಕೊಳ್ಳುವುದಿಲ್ಲ.'),('get_schedule_enter_email','ko','자신의 국가의 모든 예방 접종 전 무료 이메일 알람으로 <WHO_LINK_START&&>WHO<WHO_LINK_END&&>의 모든 권장 예방 접종을 위한 일정을 확인하세요. 이메일은 예방접종 알람 목적으로만 사용됩니다. 외부 제 3자와 이메일 주소를 공유하지 않습니다.'),('get_schedule_enter_email','ml','<WHO_LINK_START&&>ലോകാരോഗ്യ സംഘടന<WHO_LINK_END&&>  താങ്കളുടെ രാജ്യത്തിനായി ശുപാര്‍ശ ചെയ്തിട്ടുള്ള എല്ലാ കുത്തിവയ്പ്പുകളും സംബന്ധിച്ച പട്ടികയും, ഓരോ പ്രതിരോധ കുത്തിവയ്പ്പും എടുക്കേണ്ട തീയതിക്കു രണ്ടാഴ്ച മുൻപ് സൗജന്യ ഇ-മെയിൽ ഓര്‍മ്മക്കുറിപ്പും ലഭ്യമാക്കുക.  താങ്കളുടെ ഇ-മെയിൽ ഇതു സംബന്ധിച്ച ഓര്‍മ്മക്കുറിപ്പുകൾ അയക്കുവാൻ മാത്രമേ ഉപയോഗിക്കുകയുള്ളൂ.   മറ്റാരുമായും താങ്കളുടെ ഇ-മെയിൽ ഞങ്ങൾ പങ്കുവയ്ക്കുന്നതല്ല.'),('get_schedule_enter_email','mr','आपल्या देशासाठी <WHO_LINK_START&&>WHO<WHO_LINK_END&&> द्वारे शिफारस केलेल्या सर्व लसींचे वेळापत्रक आणि प्रत्येक लसीकरणाच्या दोन आठवड्यांपूर्वी एक मोफत ईमेल स्मरणपत्र मिळवा. आपला ईमेल केवळ लसीकरण स्मरणपत्रांसाठी वापरला जाईल. आम्ही कोणत्याही बाहेरील पार्टीसोबत ईमेल ऍड्रेसेस शेअर करत नाही.'),('get_schedule_enter_email','ms','Dapatkan jadual untuk semua vaksinasi yang disyorkan oleh <WHO_LINK_START&&>WHO<WHO_LINK_END&&> untuk negara anda dan peringatan percuma melalui e-mel dua minggu sebelum setiap vaksinasi. E-mel hanya digunakan untuk peringatan vaksinasi. Ia tidak akan dikongsi.'),('get_schedule_enter_email','nl','Ontvang een schema voor alle vaccinaties die door de <WHO_LINK_START&&>WHO<WHO_LINK_END&&> van jouw land worden aanbevolen en ontvang twee weken voordat je een vaccinatie nodig hebt een e-mailherinnering van ons. Het e-mailadres dat voor deze herinneringen gebruikt zal worden, zal niet worden gedeeld met anderen. '),('get_schedule_enter_email','no','Få en plan for alle vaksinene anbefalt av <WHO_LINK_START&&>WHO<WHO_LINK_END&&> for ditt land og en gratis påminnelse på e-post to uker før hver vaksine. E-posten brukes bare for vaksine påminnelser. Blir ikke delt.'),('get_schedule_enter_email','or','<WHO_LINK_START&&>ଡ଼ବ୍ଲ୍ୟୁ. ଏଚ୍.ଓ.<WHO_LINK_END&&>ରେ  କରି କ୍ଲିକ ଡବ୍ଲ୍ୟୁ. ଏଚ.ଓ. ଦ୍ଵାରା ଆପଣଙ୍କ ଦେଶପାଇଁ ସୁପାରିଶ କରାଯାଇଥିବା ଟୀକାକରଣ ତାଲିକା ଏବଂ ପ୍ରତ୍ୟେକ ଟୀକାକରଣର ଦୁଇ ସପ୍ତାହ ପୂର୍ବରୁ ମାଗଣା ଇମେଲ ସ୍ମରଣପତ୍ର ପାଆନ୍ତୁ। ଆପଣଙ୍କ ଇମେଲ କେବଳ ଟୀକାକରଣର ସ୍ମରଣପତ୍ର ନିମନ୍ତେ ବ୍ୟବହୃତ ହେବ। ଆମେ ଇମେଲ ଠିକଣାକୁ ଅନ୍ୟ କାହାସହ ସେୟାର କରୁନୁ।'),('get_schedule_enter_email','pl','Uzyskaj harmonogram wszystkich szczepień zalecanych przez <WHO_LINK_START&&>WHO<WHO_LINK_END&&> dla swojego kraju oraz bezpłatne przypomnienie e-mailem na dwa tygodnie przed każdym szczepieniem. Twój e-mail będzie używany tylko do przypomnień o szczepieniach. Nie udostępniamy adresów e-mail żadnemu podmiotowi zewnętrznemu.\n'),('get_schedule_enter_email','pt','Obtenha um cronograma de todas as vacinações recomendadas pela <WHO_LINK_START&&>OMS<WHO_LINK_END&&> para o seu país e um alerta gratuito, por e-mail, duas semanas antes de cada vacinação. Seu e-mail será utilizado apenas para alertas sobra vacinação. Nós não compartilhamos os endereços de e-mail com terceiros.'),('get_schedule_enter_email','ro','Obțineți un program al tuturor vaccinărilor recomandate de <WHO_LINK_START&&>OMS<WHO_LINK_END&&> pentru țara dvs. și un memento gratuit prin e-mail, cu două săptămâni înainte de fiecare vaccin. Adresa de e-mail va fi utilizată numai pentru mementouri legate de vaccinuri. Nu transmitem adresele de e-mail terților.'),('get_schedule_enter_email','ru','Получите график всех прививок, рекомендованных <WHO_LINK_START&&>ВОЗ<WHO_LINK_END&&>вашей страны и бесплатные напоминания по электронной почте за две недели до каждой вакцинации. Ваш адрес электронной почты будет использоваться только для отправки напоминаний о вакцинации. Мы не сообщаем адреса электронной почты сторонним организациям. '),('get_schedule_enter_email','sk','Získajte harmonogram všetkých očkovaní odporúčaných organizáciou <WHO_LINK_START&&>WHO<WHO_LINK_END&&> pre vašu krajinu a bezplatné pripomenutie e-mailom dva týždne pred očkovaním. Váš e-mail bude použitý iba na pripomenutia týkajúce sa očkovania. E-mailové adresy nezdieľame so žiadnymi tretími stranami.'),('get_schedule_enter_email','sl','Zagotovite si urnik vseh cepljenj, ki jih priporoča <WHO_LINK_START&&>WHO<WHO_LINK_END&&> za vašo državo in brezplačni e-poštni opomnik dva tedna pred vsakim cepljenjem. Vaš e-poštni naslov bomo uporabili samo za pošiljanje opomnikov. E-poštnih naslovov ne dajemo zunanjim osebam.'),('get_schedule_enter_email','sv','Få ett schema över alla vaccinationer som rekommenderas av WHO av <WHO_LINK_START&&>WHO<WHO_LINK_END&&> för ditt land och en gratis epostpåminnelse två veckor innan varje vaccination. Din epost kommer enbart att användas för vaccinations-påminnelser. Vi delar inte din epost-information med någon annan.'),('get_schedule_enter_email','ta','உங்கள் நாட்டுக்காக <WHO_LINK_START&&>WHO<WHO_LINK_END&&> நிறுவனத்தால் பரிந்துரைக்கப்பட்டுள்ள அனைத்து தடுப்பூசிகளின் அட்டவணையைப் பெற்று, தடுப்பூசிக்கு இரண்டு வாரங்களுக்கு முன்பு இலவச மின்னஞ்சல் நினைவூட்டலைப் பெற்றிடுங்கள். உங்கள் மின்னஞ்சல் தடுப்பூசி நினைவூட்டல்களுக்காக மட்டுமே பயன்படுத்தப்படும். எந்தவிதமான வெளிப்புறத் தரப்பினர்களுக்கும் நாங்கள் மின்னஞ்சல் முகவரிகளைப் பகிர மாட்டோம்.'),('get_schedule_enter_email','te','మీ దేశానికి అణుగుణంగా సిఫారస్సు చేయబడిన టీకాలన్నిటి పట్టిక పొందడానికి <WHO_LINK_START&&>డబ్ల్యు హెచ్ ఓ<WHO_LINK_END&&> ప్రతి టీకాకి ముందు కనీసం రెండు వారాల ముందు ఉచిత ఇమెయిల్ ద్వారా జ్ణాపకం చేయబడుతుంది. మీ ఇమెయిల్ కేవలం టీకాలు గురించి జ్ణాపకలు పంపించడానికే వాడబడుతుంది. మేము బయట వారితో ఇమెయిల్ అడ్రస్ ను షేర్ చేయము.'),('get_schedule_enter_email','th','รับตารางการฉีดวัคซีน แนะนำโดย <WHO_LINK_START&&>WHO<WHO_LINK_END&&> สำหรับประเทศของคุณ และรับการแจ้งเตือนฟรี 2 สัปดาห์ล่วงหน้า เราจะใช้อีเมลของคุณในการแจ้งเตือนการฉีดวัคซีนเท่านั้น และไม่มอบให้กับบุคคลที่สามแต่อย่างไร '),('get_schedule_enter_email','tr','Ülkeniz için <WHO_LINK_START&&>WHO<WHO_LINK_END&&> tarafından önerilen tüm aşıların takvimini ve her aşıdan iki hafta önce ücretsiz hatırlatma e-postası alın. E-posta adresiniz yalnızca aşı hatırlatmaları için kullanılacaktır. Paylaşılmayacaktır.'),('get_schedule_enter_email','uk','Отримайте графік усіх щеплень, рекомендованих <WHO_LINK_START &&> WHO <WHO_LINK_END &&> для вашої країни та безкоштовне нагадування електронною поштою за два тижні до вакцинації. Ваша електронна адреса буде використовуватися лише для нагадувань вакцинації. Ми не повідомляємо електронні адреси стороннім особам.\n'),('get_schedule_enter_email','ur','تمام سفارش کردہ ویکسینیشنز کا شیڈول حاصل کریں<WHO_LINK_START&&>WHO<WHO_LINK_END&&> اپنے ملک سے متعلق اور ہر ویکسینیشن سے دو ہفتے قبل بذریعہ ای میل یاددہانی نوٹس حاصل کریں. آپ کی ای میل کو صرف ویکسینیشن یاددہانیوں کے لیے استعمال کیا جائے گا. ہم کسی بھی خارجی فریق کے ساتھ ای میل پتوں کی شراکت نہیں کرتے ہیں. '),('get_schedule_enter_email','vi','Nhận lịch tiêm phòng theo khuyến cáo của <WHO_LINK_START&&>WHO<WHO_LINK_END&&> cho quốc gia của bạn và lời nhắc qua email miễn phí hai tuần trước mỗi lần tiêm phòng. Email của bạn sẽ chỉ nhận được lời nhắc tiêm phòng. Chúng tôi sẽ không chia sẻ email của bạn cho bất kỳ bên thứ ba nào.'),('get_schedule_enter_email','zh','获取<WHO_LINK_START&&>世界卫生组织（WHO）<WHO_LINK_END&&>建议您的国家接种的所有疫苗并在每次接种前两周免费获得电子邮件提醒。您的邮箱将仅用于接收疫苗接种提醒，不会对外公开。'),
