00% free and takes only a few seconds:'),('thanks_share_signup','es','¿Crees que estos recordatorios de vacunación podrían ser útiles también para tus amigos?. Si es así, hazles saber que pueden inscribirse en menos de 10 segundos en <WEB_NAME&&> y que es 100% gratuito:'),('thanks_share_signup','fa','آیا دوستانی دارید که چنین یادآوری واکسنی برایشان مفید باشد؟ اگر دارید، لطفا آنها را در جریان بگذارید که ثبت نام در <&&WEB_NAME> کاملا رایگان است و بیشتر از چند ثانیه طول نمی کشد: '),('thanks_share_signup','fi','Onko sinulla ystäviä, jotka saattaisivat myös kiinnostua rokotemuistutuksista? Kerrothan heille, että <WEB_NAME&&>-sivulle liittyminen on täysin ilmaista ja vie vain muutaman sekunnin:'),('thanks_share_signup','fr','Pensez-vous que ces rappels de vaccination pourraient être utiles aussi pour vos amis, si c\'est le cas, faites-leur savoir qu\'ils peuvent s\'inscrire en moins de 10 secondes sur <WEB_NAME&&> et qu\'il est 100% gratuit:'),('thanks_share_signup','gu','શું તમારી પાસે એવા મિત્રો છે કે જેઓ આ રસીકરણની રીમાઇન્ડર્સ ઉપયોગી પણ શોધી શકે છે? જો એમ હોય, તો કૃપા કરીને તેમને જણાવો કે <WEB_NAME&&> પર સાઇન-અપ 100% ફ્રી છે અને ફક્ત થોડી સેકંડ લાગે છે:'),('thanks_share_signup','he','האם אתה חושב שהתראות חיסונים יכולים להיות שימושיים גם עבור החברים שלך, אם כן עדכן אותם שניתן להירשם בפחות מ-10 שניות ב-<WEB_NAME&&> וזה לגמרי בחינם:'),('thanks_share_signup','hi','क्या आपको लगता है कि ये टीकाकरण अनुस्मारक आपके दोस्तों के लिए भी उपयोगी हो सकते हैं? यदि ऐसा है तो उन्हें बताएं कि वे 10 मिनट से कम समय में <WEB_NAME&&> पर पंजीकरण कर सकते हैं और यह 100% नि:शुल्क है:'),('thanks_share_signup','hr','Imate li prijatelje kojima bi ovi podsjetnici na cijepljenje mogli također biti korisni? Ako imate, molimo vas da ih obavijestite da je prijava na <WEB_NAME&&> 100 % besplatna i traje samo nekoliko sekundi:'),('thanks_share_signup','hu','Ha úgy gondolja, hogy ezek az oltási emlékeztetők hasznosak lehetnek ismerőseinek is, szóljon nekik, hogy kevesebb mint 10 másodperc alatt regisztrálhatnak a <WEB_NAME&&>-on, ami teljesen ingyenes:'),('thanks_share_signup','it','Pensi che questi promemoria delle vaccinazioni potrebbero essere utili anche per i tuoi amici? in tal caso fagli sapere che possono registrarsi su <WEB_NAME&&> è gratuito al 100% e ci vogliono solo pochi secondi:'),('thanks_share_signup','ja','お友達にもこれらのワクチン接種のリマインダーをお知らせしませんか？<WEB_NAME&&>で10秒以内にサインアップでき、100％無料であることをぜひお知らせください。'),('thanks_share_signup','ka','ಈ ಲಸಿಕಾ ಜ್ಞಾಪನೆಗಳು ನಿಮ್ಮ ಸ್ನೇಹಿತರಿಗೆ ಉಪಯೋಗವಾಗಬಹುದೆಂದು ನೀವು ಭಾವಿಸುತ್ತೀರಾ? ಹಾಗಿದ್ದಲ್ಲಿ ಅವರು <WEB_NAME&&> ನಲ್ಲಿ ಸಂಪೂರ್ಣ ಉಚಿತವಾಗಿ ಸೈನ್ ಅಪ್ ಮಾಡಬಹುದು ಮತ್ತು ಅದು ಕೆಲವು ಸೆಕೆಂಡುಗಳನ್ನು ಮಾತ್ರ ತೆಗೆದುಕೊಳ್ಳುತ್ತದೆ ಎಂದು ಅವರಿಗೆ ತಿಳಿಸಿ.'),('thanks_share_signup','ko','저희의 예방접종 알림 서비스가 필요하신 지인이나 친구분이 있으신가요? 그렇다면 그 친구분 혹은 지인에게 가입 추천 부탁드립니다. <WEB_NAME&&> 은 무료로 가입하실 수 있으며 가입절차 또한 매우 간단합니다:'),('thanks_share_signup','ml','പ്രതിരോധ കുത്തിവയ്പ്പുകൾ സംബന്ധിച്ച ഓർമ്മപ്പെടുത്തലുകൾ ഉപയോഗപ്രദമാകുന്ന കൂട്ടുകാർ താങ്കൾക്ക് ഉണ്ടോ? എങ്കിൽ <WEB_NAME&&>-ൽ സൈനപ്പ് ചെയ്യുവാൻ ഏതാനും സെക്കൻറുകൾ മാത്രമേ വേണ്ടൂ എന്നും അത് നൂറു ശതമാനം സൗജന്യമാണെന്നും അവരെ അറിയിക്കുക. '),('thanks_share_signup','mr','आपल्याला असे मित्र आहेत का ज्यांनासुद्धा हि लसीकरण स्मरणपत्रे उपयुक्त वाटू शकतात? तसे असल्यास, कृपया त्यांना कळवा की <WEB_NAME&&> येथे साइन-अप १००% मोफत आहे आणि त्यासाठी फक्त काही सेकंद लागतात:'),('thanks_share_signup','ms','Jika anda merasa peringatan vaksin ini juga berguna untuk rakan-rakan anda, beritahu mereka bahawa pendaftaran di <WEB_NAME&&> mengambil masa kurang daripada 10 saat dan adalah 100% percuma:'),('thanks_share_signup','nl','Denk je dat deze vaccinatiemeldingen ook nuttig kunnen zijn voor je vrienden, laat hen dan weten dat ze zich binnen 10 seconden kunnen aanmelden bij <WEB_NAME&&>. Dit is 100% gratis:'),('thanks_share_signup','no','Tror du at disse vaksinasjonspåminnelsene kan være nyttige også for vennene dine, hvis det er tilfelle, la dem få vite at de kan registrere seg på mindre enn 10 sekunder på <WEB_NAME&&>, og det er 100% gratis:'),('thanks_share_signup','or','ଆପଣଙ୍କ କେହି ସାଙ୍ଗ ଅଛନ୍ତି କି ଯାହାଙ୍କର ଏହି ଟୀକାକରଣ ସ୍ମରଣପତ୍ରଗୁଡାକ ଦରକାରରେ ଆସିପାରେ? ଯଦି ଅଛନ୍ତି ତାହେଲେ ତାଙ୍କୁ ଜଣାନ୍ତ ଯେ <WEB_NAME&&>ରେ ପଞ୍ଜିକରଣ କରିବା ହେଉଛି 100% ମାଗଣା ଏବଂ ଏହା ଅଳ୍ପ କିଛି ସେକଣ୍ଡରେ ହେଇଯାଏ'),('thanks_share_signup','pl','Czy uważasz, że te przypomnienia o szczepieniach mogą być przydatne także dla twoich znajomych, jeśli tak, daj im znać, że mogą zarejestrować się w mniej niż 10 sekund na <WEB_NAME&&> w 100% bezpłatnie: '),('thanks_share_signup','pt','Você tem amigos que também poderiam achar úteis estes alertas de vacinação? Se sim, peça que eles se inscrevam no <WEB_NAME&&> gratuitamente. Demora apenas alguns segundos.'),('thanks_share_signup','ro','Aveți prieteni care ar putea considera și ei utile aceste mementouri de vaccinare? Dacă da, anunțați-i că înscrierea la <WEB_NAME&&> este complet gratuită și durează doar câteva secunde:'),('thanks_share_signup','ru','Возможно, у вас есть друзья, которым могут быть полезны такие напоминания о вакцинации. Пожалуйста, расскажите им, что регистрация на <WEB_NAME&&> на 100% бесплатна и займет всего несколько секунд.'),('thanks_share_signup','sk','Máte priateľov, pre ktorých by mohli byť tieto pripomenutia očkovaní tiež užitočné? Ak áno, dajte im vedieť, že registrácia na <WEB_NAME&&> je 100 % bezplatná a trvá iba pár sekúnd:'),('thanks_share_signup','sl','Ali imate prijatelje, katerim bi ti opomniki prav tako koristili? Obvestite jih, da je registracija na <WEB_NAME&&> 100 % brezplačna in traja samo nekaj sekund:'),('thanks_share_signup','sv','Tycker du att dessa vaccinationspåminnelser kan vara användbara även för dina vänner? Om ja, låt dem veta att de kan registrera sig på mindre än 10 sekunder på <WEB_NAME&&> och att det är 100% gratis:'),('thanks_share_signup','ta','இந்த தடுப்பூசி நினைவூட்டல்கள் பயனுள்ளதாக இருக்கக்கூடிய நண்பர்கள் உங்களுக்கு உள்ளனரா? ஒருசில நொடிகளுக்குள் அவர்களால் <WEB_NAME&&> -ல் பதிவு செய்து கொள்ளமுடியும் என்பதையும், இது 100% இலவசமானது என்பதையும் அவர்களுக்கு தெரிவித்திடுங்கள்.'),('thanks_share_signup','te','ఈ జ్ణాపికలు ఉపయోగపడగల ఇతర స్నేహితులు మీకువున్నారా? అలాగైతే, దయచేసి <WEB_NAME&&> లో సైన్-అప్ అవ్వడం వందశాతం ఉచితం మరియు కేవలం కొన్ని సెకండ్లు పడుతుందని తెలియజేయండి.'),('thanks_share_signup','th','คุณคิดว่าการแจ้งเตือนการฉีดวัคซีนเหล่านี้จะมีประโยชน์สำหรับเพื่อนของคุณหรือไม่ ถ้าใช่ กรุณาแจ้งให้พวกเขาทราบว่า เขาสามารถลงทะเบียนได้ที่ <WEB_NAME&&> ฟรี 100% และใช้เวลาเพียงไม่กี่วินาที'),('thanks_share_signup','tr','Bu aşı hatırlatıcılarının arkadaşlarınız için de kullanışlı olabileceğini düşünüyor musunuz, eğer öyleyse onlara da söyleyin, <WEB_NAME&&> üzerinden tamamen ücretsiz olarak 10 saniyede kayıt olabilirler.'),('thanks_share_signup','uk','У вас є друзі, які також можуть знайти ці нагадування про вакцинацію корисними? Якщо це так, дайте їм знати, що реєстрація на сайті <WEB_NAME &&> на 100% безкоштовна та займає лише кілька секунд.\n'),('thanks_share_signup','ur','کیا آپ کے ایسے احباب ہیں جو ان یاددہانیوں بحوالہ ویکسینیشن کو مفید تصور کرتے ہیں؟ اگر ایسا ہے، تو براہ مہربانی انہیں آگاہ کریں کہ وہ <WEB_NAME&&> پر مفت سائن اپ کر سکتے ہیں اور اس عمل میں محض چند سیکنڈز لگتے ہیں.'),('thanks_share_signup','vi','Bạn có bạn bè cũng cảm thấy những lời nhắc tiêm phòng này là hữu ích? Nếu vậy, hãy cho họ biết rằng đăng ký <WEB_NAME&&> là miễn phí 100%, và chỉ tốn vài giây thôi:'),('thanks_share_signup','zh','您觉得这些疫苗接种提醒对您的朋友有用吗？如果您觉得有用，请告诉他们，以便于他们能够在10秒钟之内通过<WEB_NAME&&>注册，完全免费：'),
('thanks_spam','ar','إذا لم تستلم الرسالة الإلكترونية خلال 15 دقيقة القادمة، فيرجى التحقق من صندوق الرسائل غير المرغوب فيها. هناك دائما احتمال أن لا يتم تلقي \n رسائل التذكير عبر البريد الإلكتروني في المستقبل أو يمكن أن يتم تصنيفها كرسائل غير مرغوب فيها. لذلك للإحتياط ننصح بتسجيل التواريخ مباشرة في التقويم الخاص بك.'),('thanks_spam','bg','Ако не получите имейл в рамките на следващите 15 минути, моля, проверете папката спам. Винаги съществува възможност имейл напомнянето в бъдеще да не бъде доставено или да бъде филтрирано като спам. За да бъдете сигурни, препоръчваме ви да въведете датите директно в календара си.'),('thanks_spam','bn','যদি আপনি পরবর্তী ১৫ মিনিটের মধ্যে ইমেইল না পান, অনুগ্রহপূর্বক আপনার স্প্যাম বক্সটি দেখুন। ভবিষ্যতে ইমেইল রিমাইন্ডার হয়তো ডেলিভার না হওয়ার অথবা স্প্যাম হিসাবে ফিল্টার হয়ে যাওয়ার সম্ভাবনা সবসময়ই থাকে। তাই নিশ্চিন্তে থাকতে, আমরা আপনাকে আপনার ক্যালেন্ডারে সরাসরি তারিখ লিখে রাখতে সুপারিশ করবো। '),('thanks_spam','ca','Si no has rebut un correu electrònic en els propers 15 minuts, comprova la teva carpeta de correu brossa. Sempre hi ha la possibilitat que un futur recordatori no es pugui lliurar o es pugui filtrar com a correu brossa. Així que, idealment, introdueix les dates directament al teu calendari.'),('thanks_spam','cs','Pokud neobdržíte email během příštích 15 minut, zkontrolujte prosím svou složku spamu. Vždy je zde možnost, že vám v budoucnu nebude doručena emailová připomínka nebo že bude filtrem označena jako spam. Ideálně si proto zadejte data přímo do svého kalendáře.'),('thanks_spam','da','Hvis du ikke modtager e-mailen inden for de næste 15 minutter, så kontroller venligst din spam boks. Der er altid en mulighed fro, at en e-mailpåmindelse i fremtiden ikke bliver leveret, eller bliver filtreret som spam. Så blot for at være på den sikre side, så anbefaler vi at du skriver datoerne direkte i din kalender. '),('thanks_spam','de','Sollten Sie die E-Mail innerhalb der nächsten 15 Minuten nicht erhalten, überprüfen Sie bitte Ihren Spam-Ordner. Es besteht immer die Möglichkeit, dass eine E-Mail-Erinnerung in Zukunft möglicherweise nicht mehr geliefert oder als Spam herausgefiltert wird. Geben Sie die Daten idealerweise direkt in Ihren Kalender ein.'),('thanks_spam','el','Εάν δεν λάβεις το email εντός των επόμενων 15 λεπτών, σε συμβουλεύουμε να ρίξεις μια ματιά στον Φάκελο Spam (Ανεπιθύμητα). Υπάρχει πάντα η πιθανότητα κάποια από τις υπενθυμίσεις να φιλτραριστεί και να σταλθεί στον Φάκελο Spam. Έτσι, για σιγουριά, συνιστούμε να γράψεις απευθείας τις ημερομηνίες στο Ημερολόγιό σου.'),('thanks_spam','en','If you do not receive the email within the next 15 mins, please check your spam box. There is always a possibility that an email reminder in the future may not get delivered or may be filtered out as spam. So just to be on the safe side, we recommend that you enter the dates directly in your calendar.'),('thanks_spam','es','Si no recibes el correo electrónico en los próximos 15 minutos, revisa tu carpeta de correo no deseado. Siempre existe la posibilidad de que un recordatorio por correo electrónico en el futuro no se entregue o se pueda filtrar como correo no deseado. Por lo tanto, es aconsejable que insertes las fechas directamente en tu calendario.'),('thanks_spam','fa','اگر در ۱۵ دقیقه آینده هیچ ایمیلی دریافت نکردید، لطفا قسمت spam (تلفظ: اسپم) خود را چک کنید. چون امکان این هست که ایمیلهای یادآور آینده یا به دستتان نرسند و یا به قسمت spam بروند. به همین دلیل، برای اطمینان خاطرتان پیشنهاد می کنیم که تاریخهای داده شده را مستقیم وارد تقویمتان کنید.'),('thanks_spam','fi','Jos et saa sähköpostia seuraavan 15 minuutin kuluessa, tarkista roskapostikansio. On aina mahdollista, että tulevaisuudessa muistutussähköposti ei saavu perille tai se suodatetaan roskapostikansioon. Varmistaaksesi, etteivät tiedot katoa, suosittelemme, että merkitset päivämäärät suoraan kalenteriisi. '),('thanks_spam','fr','Si vous ne devriez pas recevoir l\'email dans les 15 prochaines minutes, veuillez vérifier votre dossier spam. Il est toujours possible qu\'un rappel par e-mail à l\'avenir ne soit pas livré ou qu\'il puisse être filtré en tant que spam. Donc, idéalement, entrez les dates directement dans votre calendrier.'),('thanks_spam','gu','જો તમને આગલી 15 મિનિટની અંદર ઇમેઇલ પ્રાપ્ત ન થાય, તો કૃપા કરીને તમારા સ્પામ બૉક્સને તપાસો. હંમેશાં એવી શક્યતા છે કે ભવિષ્યમાં ઇમેઇલ રિમાઇન્ડર વિતરિત ન થઈ શકે અથવા સ્પામ તરીકે ફિલ્ટર થઈ શકે. તેથી માત્ર સલામત બાજુ પર રહેવા માટે, અમે ભલામણ કરીએ છીએ કે તમે તારી કૅલેન્ડરમાં સીધા તારીખો દાખલ કરો.'),('thanks_spam','he','אם אינך מקבל מייל זה ב-15 הדקות הקרובות , בדוק את תיקיית הספאם שלך. קיימת תמיד אפשרות שהתראת מייל בעתיד לא תועבר, או שתתקבל כדואר זבל. לכן רצוי להזין את התאריכים ישירות בלוח השנה שלך.'),('thanks_spam','hi','अगर आपको अगले 15 मिनट में ईमेल नहीं मिला, तो कृपया अपना स्पैम फ़ोल्डर जांचें। एक संभावना हमेशा रहती है कि भविष्य में कोई ईमेल अनुस्मारक आप तक न पहुँच पाए या स्पैम के रूप में फ़िल्टर हो जाए। इसलिए आदर्श यही होगा कि आप सीधे अपने कैलेंडर में तिथियां दर्ज करें।'),('thanks_spam','hr','Ako ne primite e-mail u sljedećih 15 minuta, provjerite svoju mapu neželjene pošte. Uvijek postoji mogućnost da se podsjetnik e-mailom ubuduće ne isporuči ili se može filtrirati kao neželjeni sadržaj. Zato, kako biste bili sigurni, preporučujemo da unesete datume izravno u svoj kalendar.'),('thanks_spam','hu','Ha nem kapja meg az e-mailt a következő 15 percben, kérjük ellenőrizze a spam mappát. Előfordulhat, hogy a jövőben nem kap meg egy e-mailes emlékeztetőt, vagy spamként lesz megjelölve. Ezért az a legjobb, ha a dátumokat beírja közvetlenül a naptárába.'),('thanks_spam','it','Se non dovessi ricevere l\'email entro i prossimi 15 minuti, controlla la tua cartella spam. Esiste sempre la possibilità che un promemoria e-mail in futuro non venga consegnato o filtrato come spam. Quindi inserisci idealmente le date direttamente nel tuo calendario.'),('thanks_spam','ja','15分以内にメールを受信されなかった場合は、迷惑メールフォルダを確認してください。今後の電子メールリマインダが配信されない、または迷惑メールとして除外される可能性が常にあります。カレンダーに直接日付を入力するのがおすすめです。'),('thanks_spam','ka','ಮುಂದಿನ 15 ನಿಮಿಷಗಳಲ್ಲಿ ನಿಮಗೆ ಇಮೇಲ್ ಬರದಿದ್ದರೆ ದಯವಿಟ್ಟು ನಿಮ್ಮ ಸ್ಪ್ಯಾಮ್ ಬಾಕ್ಸ್ ಪರಿಶೀಲಿಸಿ. ಮುಂದೆ ಕೂಡ ಇಮೇಲ್ ಜ್ಞಾಪನೆ ನಿಮಗೆ ತಲುಪದೆ ಸ್ಪ್ಯಾಮ್ ಎಂದು ಪರಿಗಣಿಸಲ್ಪಡುವ ಸಾಧ್ಯತೆ ಇದೆ. ಈ ತೊಂದರೆ ತಪ್ಪಿಸಲು, ನೇರವಾಗಿ ನಿಮ್ಮ ಕ್ಯಾಲೆಂಡರಿನಲ್ಲಿ ದಿನಾಂಕಗಳನ್ನು ನಮೂದಿಸಲು ನಾವು ಸೂಚಿಸುತ್ತೇವೆ.'),('thanks_spam','ko','만약 15분 안에 이메일을 받지 못하신 경우, 본인의 스팸메일함을 확인해 주세요. \n이메일 알람을 설정하셨을 경우, 메일이 전달되지 않거나 스팸으로 분류되는 경우들이 있습니다. \n만약의 경우를 대비하여, 날짜를 직접 캘린더에 입력하시는 것을 권장드립니다. \n\n\n\n\n'),('thanks_spam','ml','അടുത്ത പതിന‍ഞ്ചു മിനിട്ടിനുള്ളിൽ താങ്കൾക്ക് ഇ-മെയിൽ ലഭിച്ചില്ലെങ്കിൽ താങ്കളുടെ സ്പാം ബോക്സ് പരിശോധിക്കുക. ഭാവിയിൽ ഇ-മെയിൽ ഓർമ്മക്കുറിപ്പുകൾ ലഭിക്കാതിരിക്കുവാനോ അല്ലെങ്കിൽ അവ സ്പാം ആയി ഫിൽട്ടർ ചെയ്യപ്പെടുവാനോ സാദ്ധ്യതയുള്ളതിനാൽ സുരക്ഷിതമായിരിക്കുവാനായി താങ്കളുടെ കലണ്ടറിൽ തീയതികൾ രേഖപ്പെടുത്തുവാൻ ഞങ്ങൾ ശുപാർശ ചെയ്യുന്നു.'),('thanks_spam','mr','जर पुढील १५ मिनिटांमध्ये आपणांस ईमेल प्राप्त न झाल्यास, कृपया आपला स्पॅम बॉक्स तपासा. भविष्यात एखादे  ईमेल स्मरणपत्र वितरित केले जाऊ शकत नाही किंवा स्पॅम म्हणून फिल्टर केले जाऊ शकते अशी नेहमीच शक्यता आहे.  त्यामुळे केवळ सुरक्षित बाजूला असण्यासाठी, आम्ही शिफारस करतो की आपण थेट आपल्या कॅलेंडरमध्ये तारखा प्रविष्ट करा.'),('thanks_spam','ms','Jika anda tidak menerima e-mel tersebut dalam masa 15 minit selepas ini, sila semak folder spam anda. Terdapat kemungkinan peringatan e-mel pada masa akan datang mungkin tidak dihantar atau ditapis sebagai spam. Maka, sebaiknya masukkan tarikh terus ke kalendar anda.'),('thanks_spam','nl','Indien je binnen 15 minuten geen e-mail van ons ontvangt, kijk dan even in je SPAM. Er is helaas altijd de mogelijkheid dat een e-mail in je SPAM blijft hangen waardoor je wellicht informatie misloopt. Om er zeker van te zijn dat je vaccinatie mist, raden wij het je aan om alle data vast in je agenda te zetten.  '),('thanks_spam','no','Hvis du ikke skal motta e-posten innen de neste 15 minuttene, vennligst sjekk din spammappe. Det er alltid en mulighet for at en e-postpåminnelse i fremtiden ikke blir levert eller kan bli filtrert ut som spam. Så legg inn datoene direkte i kalenderen din.'),('thanks_spam','or','ଯଦି ଆପଣ ଇମେଲଟି 15ଦିନ ମଧ୍ୟରେ ପାଇ ନାହାନ୍ତି ତେବେ ନିଜ ସ୍ପାମ୍ ବାକ୍ସକୁ ଯାଇ ଦେଖନ୍ତୁ। ପ୍ରାୟତଃ ଏହିପରି ହୁଏ ଯେ ଅନୁସ୍ମାରକ ଇମେଲଟି ପ୍ରେରିତ ହୁଏନି ଅଥବା ସ୍ପାମ୍ ବାକ୍ସରେ ରହିଯାଏ। ତେଣୁ ସବୁଠୁ ସୁରକ୍ଷିତ ରହିବାକୁ ଆମେ ପରାମର୍ଶ ଦେଉଛୁ ଯେ ଆପଣ ଉକ୍ତ ତାରିଖକୁ ସିଧା ନିଜ କାଲେଣ୍ଡେରରେ ଲେଖିଦିଅନ୍ତୁ।'),('thanks_spam','pl','Jeśli nie otrzymasz e-maila w ciągu 15 minut, sprawdź folder spamu. Zawsze istnieje możliwość, że przypomnienie e-mailem w przyszłości może nie zostać dostarczone lub może zostać odfiltrowane jako spam. Najlepiej wpisać daty bezpośrednio w kalendarzu.'),('thanks_spam','pt','Caso você não receba o e-mail dentro dos próximos 15 minutos, favor verificar sua caixa de spam. Sempre há a possibilidade de um alerta não ser entregue no futuro ou que ser filtrado pela sua caixa de e-mail como spam. Por esta razão, recomendamos que você já marque todas as datas diretamente no seu calendário.'),('thanks_spam','ro','Dacă nu primiți e-mailul în următoarele 15 minute, verificați căsuța de spam. E întotdeauna posibil ca un memento viitor prin e-mail să nu fie livrat sau poate fi filtrat ca spam. Deci, doar pentru siguranță, vă recomandăm să introduceți datele direct în calendarul personal.'),('thanks_spam','ru','Если вы не получите электронное письмо в течение следующих 15 минут, проверьте папку со спамом. Всегда есть вероятность того, что в будущем напоминания по электронной почте не будут доставлены или могут быть отфильтрованы как спам. Поэтому лучше всего ввести даты непосредственно в календарь. '),('thanks_spam','sk','Ak nedostanete e-mail v priebehu nasledujúcich 15 minút, skontrolujte si priečinok Spam. Vždy je možné, že e-mailové pripomenutie nebude v budúcnosti doručené alebo môže byť vyfiltrované ako spam. Preto vám odporúčame dátumy si pre istotu zapísať do kalendára.'),('thanks_spam','sl','Če e-poštnega sporočila ne prejmete v naslednjih 15 minutah, preverite vaš predal neželene pošte. Vedno obstaja možnost, da se opomnik tretira kot neželena pošta. Zato vam tudi priporočamo, da si datume sami vnesete v koledar.'),('thanks_spam','sv','Kolla i din skräppostmapp om du inte skulle få e-postmeddelandet inom de närmaste 15 minuterna. Det finns alltid en möjlighet att en e-postpåminnelse i framtiden kanske inte kan levereras eller kan filtreras ut som spam. Ange därför datumen direkt i kalendern.'),('thanks_spam','ta','அடுத்த 15 நிமிடங்களுக்குள் நீங்கள் மின்னஞ்சலைப் பெறாத பட்சத்தில், தயவுசெய்து உங்கள் ஸ்பேம் பாக்ஸை பார்க்கவும். எப்போதுமே எதிர்காலத்தில் மின்னஞ்சல் நினைவூட்டல் டெலிவரி செய்யப்படாமல் போகவோ அல்லது ஸ்பேமாக ஃபில்டர் செய்யப்படவோ வாய்ப்புள்ளது. எனவே, பாதுகாப்புக்காக நீங்கள் உங்கள் காலண்டரில் நேரடியாக தேதிகளை உள்ளிடுமாறு பரிந்துரைக்கிறோம்.'),('thanks_spam','te','మరో పదిహేను నిముషాల్లో మీకు ఇమెయిల్ అందకపోతే, దయచేసి స్పామ్ బాక్స్ చూడండి. భవిష్యత్తులో ఇమెయిల్ జ్ఞాపిక అందకపోవచ్చు అలాగే స్పామ్ లోకి ఫిల్టర్ చేయబడవచ్చు. కాబట్టి ఓ ముందు జాగ్రత్తగా, మీ క్యాలెండర్లో నేరుగా రాసుకోమని మిమ్మల్ని కోరుతున్నాము.'),('thanks_spam','th','หากคุณไม่ได้รับอีเมลภายใน 15 นาทีถัดไป โปรดตรวจสอบโฟลเดอร์สแปม คุณอาจจะไม่ได้รับการแจ้งเตือนทางอีเมลในอนาคต เพราะข้อความอาจจะถูกระบุว่าเป็นสแปม ดังนั้น เพื่อป้องกันปัญหา เราแนะนำให้คุณบันทึกวันที่ในตารางปฏิทินของคุณ'),('thanks_spam','tr','Eğer e-postayı 15 dk içerisinde almazsanız, lütfen Spam dosyanızı kontrol edin. Gelecekte de her zaman aşı hatırlatmalarının e-posta adresinize ulaşmaması veya spam olarak filtrelenmesi durumu söz konusu olabilir. Dolayısıyla tarihleri direkt olarak takviminize girmeniz önerilmektedir.'),('thanks_spam','uk','Якщо ви не отримаєте електронний лист протягом наступних 15 хвилин, перевірте спам-поле. Завжди існує така можливість, що нагадування електронною поштою в майбутньому може бути недоступним або може бути відфільтровано як спам. Тому, щоб бути на безпечній стороні, радимо ввести дати безпосередньо у свій календар.\n'),('thanks_spam','ur','اگر آپ کو اگلے 15 منٹوں میں ای میل موصول نہیں ہوتی ہے، تو براہ مہربانی اپنے سپیم باکس کی پڑتال کریں. اس بات کا ہمیشہ امکان رہتا ہے کہ مستقبل میں آپ کو یاددہانی ای میل موصول نہ ہو یا سپیم کے ذریعے فلٹر نہ ہو جائے. سو اس صورتحال سے بچاؤ کے لیے سفارش کی جاتی ہے کہ آپ تاریخوں کا براہ راست اپنے کیلنڈر میں اندراج کریں.'),('thanks_spam','vi','Nếu bạn không nhận được email này trong 15 phút tới, vui lòng kiểm tra hộp thư rác. Luôn có thể có một lời nhắn email trong tương lai không được gửi đến hoặc bị lọc vào hộp thư rác. Vì vậy để bảo đảm, chúng tôi khuyến nghị bạn nhập ngày trực tiếp vào lịch.'),('thanks_spam','zh','如果在15分钟之内您没有收到电子邮件，请检查您的垃圾邮件文件夹。电子邮件提醒没有发送出去或者被当做垃圾邮件是很有可能的。所以，最好将接种日期输入您的日历中。'),
('thanks_vax_country','ar','ويستند جدول التطعيم على التوصيات الحالية لمنظمة الصحة العالمية لدولة <COUNTRY_NAME&&> . استشر دوما طبيبك في الوحدة الصحية حول ما إذا كانت هناك تطعيمات أخرى قد يوصي بها في منطقتك.'),('thanks_vax_country','bg','Графикът за ваксиниране се основава на текущите препоръки на СЗО за <COUNTRY_NAME &&>. Винаги се консултирайте с вашия местен лекар относно това дали други ваксинации могат да бъдат препоръчани за вашия регион.'),('thanks_vax_country','bn','টিকাদানের সময়সূচীটি <COUNTRY_NAME&&> এর জন্য WHO এর বর্তমান প্রস্তাবনার উপর ভিত্তি করে করা। সর্বদা আপনার স্থানীয় হেলথ প্র্যাকটিশনারের সাথে আপনার এলাকার জন্য অন্য কোন টিকা দেওয়ার পরামর্শ দেওয়া হয়েছে কিনা সে ব্যাপারে আলোচনা করুন।'),('thanks_vax_country','ca','El calendari de vacunació es basa en les recomanacions actuals de l\'OMS per a <COUNTRY_NAME&&>. Consulta sempre amb el teu practicant sobre altres possible vacunes existents per a la teva regió.'),('thanks_vax_country','cs','Časový rozpis vakcinací je založen na současném doporučení WHO pro zemi <COUNTRY_NAME&&>. Vždy se poraďte s místním praktickým lékařem, zdali se na vaši oblast nevztahují i další vakcinace.	'),('thanks_vax_country','da','Vaccinationsplanen er baseret på de nuværende WHO-anbefalinger for <COUNTRY_NAME&&>. Rådfør dig altid med din lokale læge vedrørende vaccinationer som gælder for din region.'),('thanks_vax_country','de','Der Impfplan basiert auf den aktuellen Empfehlungen der WHO für <COUNTRY_NAME&&> . Konsultieren Sie jedoch immer Ihren lokalen Gesundheitspraktiker, ob andere Impfungen für Ihre Region anwendbar sind.'),('thanks_vax_country','el','Το πρόγραμμα εμβολιασμού βασίζεται στις τρέχουσες συστάσεις του ΠΟΥ για <COUNTRY_NAME&&> . Θα πρέπει να συμβουλεύεσαι πάντα τον γιατρό σου για το εάν συνιστώνται κι άλλοι εμβολιασμοί για την περιοχή σου.'),('thanks_vax_country','en','The vaccination schedule is based on the current WHO recommendations for <COUNTRY_NAME&&>. Always consult your local health practitioner on whether other vaccinations may be recommended for your region.'),('thanks_vax_country','es','El calendario de vacunación se basa en las recomendaciones actuales de la OMS para <COUNTRY_NAME&&>. Siempre consulta con tu médico sobre otras posibles vacunas aplicables en tu región.'),('thanks_vax_country','fa','برنامه کنونی واکسن بر حسب پیشنهادات سازمان سلامت جهان برای <&&COUNTRY_NAME> می باشد. اگر می خواهید بدانید چه واکسنهای دیگری برای ناحیه تان پیشنهاد شده اند، باید با پزشک خود مشورت کنید.'),('thanks_vax_country','fi','Rokotusohjelma perustuu WHO:n tämänaikaisiin suosituksiin maassa <COUNTRY_NAME&&>. Kysy aina paikalliselta terveysalan ammattilaiselta onko alueellesi suositeltu muita rokotteita. '),('thanks_vax_country','fr','Le calendrier de vaccination est basé sur les recommandations actuelles de l\'OMS <COUNTRY_NAME&&> . Consultez toujours votre praticien de santé local pour savoir si d\'autres vaccins peuvent s\'appliquer à votre région.'),('thanks_vax_country','gu','આ રસીકરણ શેડ્યૂલ વર્તમાન ડબ્લ્યુએચઓ ભલામણો પર આધારિત છે<દેશ_નામ&&>.\nહંમેશા તમારા સ્થાનિક આરોગ્ય વ્યવસાયી સાથે સંપર્ક કરો કે કેમ તે તમારા પ્રદેશ માટે અન્ય રસીકરણની ભલામણ કરવામાં આવે છે.'),('thanks_vax_country','he','לוח החיסונים מבוסס על המלצות הארגון הבריאות העולמי הנוכחיות עבור <&&COUNTRY_NAME> . יש להתייעץ תמיד עם הרופא המקומי שלך לגבי אלו חיסונים רלוונטים אחרים קיימים באזור שלך.'),('thanks_vax_country','hi','<COUNTRY_NAME &&> के लिए टीकाकरण शिड्यूल WHO की मौजूदा  सिफ़ारिशों पर आधारित है। हमेशा अपने स्थानीय स्वास्थ्य चिकित्सक से सलाह लें। हो सकता है कि आपके क्षेत्र के लिए अन्य टीके लागू होते हों।'),('thanks_vax_country','hr','Raspored cijepljenja temelji se na aktualnim preporukama SZO-a za <COUNTRY_NAME&&>. Uvijek se posavjetujte sa svojim lokalnim liječnikom opće prakse o tome mogu li se druga cijepljenja preporučiti ​​za vašu regiju.'),('thanks_vax_country','hu','Az oltási ütemterv a WHO jelenlegi ajánlásai alapján készült <COUNTRY_NAME&&> államához. Mindig konzultáljon a helyi egészségügyi szakemberével arról, hogy más oltások elérhetőek-e a régiójában.'),('thanks_vax_country','it','Il programma di vaccinazione si basa sulle attuali raccomandazioni dell\'OMS per <COUNTRY_NAME&&> . Consulta sempre il tuo operatore sanitario locale per sapere se altre vaccinazioni potrebbero essere applicabili alla tua regione.'),('thanks_vax_country','ja','ワクチン接種スケジュールは、<COUNTRY_NAME&&> の現在のWHO勧告に基づいています。他のワクチン接種がお住まいの地域に適用されるかどうかについては、必ずお住まいの地域の保健実務家にご相談ください。'),('thanks_vax_country','ka','ಈ ಲಸಿಕಾ ವೇಳಾಪಟ್ಟಿ <COUNTRY_NAME&&> ದೇಶಕ್ಕೆ ವಿಶ್ವ ಆರೋಗ್ಯ ಸಂಸ್ಥೆಯ ಪ್ರಸ್ತುತ ಸೂಚನೆಗಳನ್ನು ಆಧರಿಸಿದೆ. ನಿಮ್ಮ ಪ್ರದೇಶಕ್ಕೆ ಹೆಚ್ಚಿನ ಲಸಿಕೆಗಳನ್ನು ಸೂಚಿಸಿರಬಹುದೇ ಎಂದು ತಿಳಿಯಲು ಯಾವತ್ತೂ ನಿಮ್ಮ ಸ್ಥಳೀಯ ವೈದ್ಯರನ್ನು ಸಂಪರ್ಕಿಸಿ.'),('thanks_vax_country','ko','백신접종 일정은 WHO 각 국가별 <COUNTRY_NAME&&> 권장사항에 근거합니다. 현재 계시는 지역에서 권장되는 예방접종이 본인에게 필요한지의 여부를 담당의사 및 전문의와 꼭 상의하시기 바랍니다. \n\n\n'),('thanks_vax_country','ml','പ്രതിരോധ കുത്തിവയ്പ്പുകൾ സംബന്ധിച്ച ഈ പട്ടിക തയ്യാറാക്കിയിരിക്കുന്നത് ലോകാരോഗ്യ സംഘടനയുടെ <COUNTRY_NAME&&>-ക്കു വേണ്ടിയുള്ള ശുപാർശകളെ ആധാരമാക്കിയാണ്.  താങ്കളുടെ പ്രദേശത്ത് മറ്റേതെങ്കിലും പ്രതിരോധ കുത്തിവയ്പ്പുകള്‍ ബാധകമാണോയെന്ന് അറിയുവാൻ താങ്കളുടെ ചുറ്റുവട്ടത്തുള്ള ഡോക്ടറുടെ ഉപദേശം തീർച്ചയായും തേടുക'),('thanks_vax_country','mr','लसीकरण वेळापत्रक हे WHO द्वारे <COUNTRY_NAME&&> साठी करण्यात आलेल्या वर्तमान शिफारसींवर आधारित आहे. आपल्या प्रदेशासाठी इतर लसीकरणाची शिफारस केली जाऊ शकते का याबाबत नेहमी आपल्या स्थानिक आरोग्य तज्ज्ञांचा सल्ला घ्या.'),('thanks_vax_country','ms','Jadual vaksinasi adalah berdasarkan saranan semasa WHO untuk negara <COUNTRY_NAME&&> . Dapatkan nasihat daripada pengamal kesihatan di tempat anda tentang vaksinasi lain yang mungkin diperlukan di kawasan anda.'),('thanks_vax_country','nl','Het vaccinatieschema is gebaseerd op de huidige WHO-aanbevelingen voor <COUNTRY_NAME&&>. Overleg altijd met je eigen huisarts of er tevens andere vaccinaties van toepassing kunnen zijn voor jouw regio.'),('thanks_vax_country','no','Vaksinasjonsplanen er basert på gjeldene WHO-anbefalinger for <COUNTRY_NAME&&> . Rådfør deg alltid med din fastlege om andre vaksiner anbefales for din region.'),('thanks_vax_country','or','ଏହି ଟୀକାକରଣ ତାଲିକାଟି <COUNTRY_NAME&&>ଦେଶପାଇଁ ଡ଼ବ୍ଲ୍ୟ.ଏଚ୍.ଓ. ଦ୍ଵାରା କରାଯାଇଥିବା ସୁପାରିଶ ଅନୁସାରେ ଆଧାରିତ। ଆପଣଙ୍କ ଅଂଚଳାପାଇଁ ଟିକାଗୁଡିକ ଉଦ୍ଧିଷ୍ଟ କି ନୁହେଁ ନିକଟସ୍ଥ ସ୍ବାସ୍ଥ୍ୟ ବିଶେଷଜ୍ଞଙ୍କ ନିକଟରୁ ବୁଝିନିଆନ୍ତୁ।'),('thanks_vax_country','pl','Harmonogram szczepień jest oparty na aktualnych zaleceniach WHO dla <COUNTRY_NAME&&>. Zawsze skonsultuj się z lokalnym lekarzem, czy inne szczepienia mogą dotyczyć twojego regionu.'),('thanks_vax_country','pt','O cronograma de vacinação é baseado nas recomendações atuais da OMS para <COUNTRY_NAME &&>. Sempre consulte seu médico local para verificar outras vacinas que possam vir a ser recomendadas para sua região.'),('thanks_vax_country','ro','Schema de vaccinare se bazează pe recomandările actuale ale OMS pentru <COUNTRY_NAME&&>. Consultați întotdeauna medicul de familie dacă și alte vaccinuri pot fi recomandate pentru regiunea dvs.'),('thanks_vax_country','ru','График прививок составлен в соответствии с текущими рекомендациями ВОЗ <COUNTRY_NAME&&>. Всегда консультируйтесь со своим врачом по поводу того, необходимы ли в вашем регионе какие-либо другие прививки.'),('thanks_vax_country','sk','Harmonogram očkovaní sa zakladá na súčasných odporúčaniach organizácie WHO pre krajinu <COUNTRY_NAME&&>. Vždy sa poraďte so svojím miestnym lekárom a zistite tak, či sú pre váš región odporúčané aj iné očkovania.'),('thanks_vax_country','sl','Načrt cepljenja temelji na sedanjih priporočilih WHO za državo <COUNTRY_NAME&&>. Vedno se posvetujte z lokalnim zdravstvenim delavcem o tem, ali so druga cepiva priporočljiva za vašo regijo.'),('thanks_vax_country','sv','Vaccinationsschemat är baserat på nuvarande WHOs rekommendationer för <COUNTRY_NAME&&>. Rådgör alltid med din lokala vårdcentral om andra vaccinationer kan vara nödvändiga för din region.'),('thanks_vax_country','ta','<COUNTRY_NAME&&> -க்கான தற்போதைய WHO பரிந்துரைகளின் அடிப்படையில் இந்த தடுப்பூசி அட்டவணை உள்ளது. உங்கள் பகுதியில் பிற எந்தவித தடுப்பூசிகளும் பொருந்தக்கூடியதா என்பது குறித்து எப்போதும் உங்கள் உள்ளூர் மருத்துவரை ஆலோசிக்கவும்.'),('thanks_vax_country','te','ఈ టీకాల ప్రణాలిక ప్రస్తుతం డబ్ల్యు హెచ్ ఓ <COUNTRY_NAME&&> కోసం సిఫారస్సు చేసినవి. మీ ప్రాంతానికి వేరే ఇతర టీకాలు వర్తిస్తాయని ఎప్పుడూ స్థానిక హేల్త్ ప్రాక్టీషనర్ ను సంప్రదించండి.'),('thanks_vax_country','th','กำหนดการฉีดวัคซีนเป็นไปตามคำแนะนำขององค์การอนามัยโลกสำหรับ <COUNTRY_NAME&&> ปรึกษาเจ้าหน้าที่สาธารณสุขในท้องถิ่นของคุณ เพื่อทราบว่ามีวัคซีนอื่นแนะนำสำหรับภูมิภาคของคุณหรือไม่'),('thanks_vax_country','tr','Aşı takvimi <COUNTRY_NAME&&> için güncel WHO önerileri baz alınarak hazırlanmıştır. Bölgenizde başka aşıların da gerekli olup olmadığıyla ilgili her zaman yerel sağlık kuruluşunuza başvurun.'),('thanks_vax_country','uk','Графік вакцинації грунтується на поточних рекомендаціях ВООЗ для <COUNTRY_NAME &&>. Завжди консультуйтеся з місцевим лікарем-медиком щодо того, чи можна рекомендувати інші вакцинації для вашого регіону.\n'),('thanks_vax_country','ur','ویکسینیشن شیڈول عالمی ادارہ صحت کی موجودہ سفارشات بنیاد پر ہے بمتعلق <COUNTRY_NAME&&>. ہمیشہ اپنے مقامی عمومی معالج صحت سے مشورہ کریں کہ آیا آپ کے علاقے کے لیے کسی اور ویکسین کی سفارش کی سکتی ہے.'),('thanks_vax_country','vi','Lịch tiêm phòng luôn dựa trên khuyến cáo hiện nay của WHO đối với  <COUNTRY_NAME&&>. Luôn trao đổi trước với y bác sĩ địa phương của bạn về việc có mũi tiêm phòng nào khác được khuyến cáo cho khu vực của bạn hay không.'),('thanks_vax_country','zh','疫苗接种方案基于现行的世界卫生组织（WHO）针对<COUNTRY_NAME&&>的建议。请首先咨询当地保健医生了解其他疫苗是否适用您所在的地区。'),
