('vax_recommended_only','ar','ينصح هذا التطعيم فقط لبعض المناطق المحددة في <COUNTRY_NAME&&> أو المجموعات المعرضة للخطر. تحقق ما إذا كان هذا التطعيم يوصى به في حالتك.'),('vax_recommended_only','bg','Тази ваксинация се препоръчва само за някои конкретни области в <COUNTRY_NAME&&> или в рискови групи. Проверете дали тази ваксинация се препоръчва във вашия случай.'),('vax_recommended_only','bn','এই টিকা শুধুমাত্র <COUNTRY_NAME&&> এর কিছু নির্দিষ্ট এলাকা অথবা উচ্চ ঝুঁকিতে থাকা গ্রুপগুলোর জন্য প্রস্তাব করা হয়। এই টিকা আপনার ক্ষেত্রে সুপারিশ করা হয় কিনা তা যাচাই করুন।'),('vax_recommended_only','ca','Aquesta vacuna només es recomana per a algunes àrees específiques <ARTICLE_D&&><COUNTRY_NAME&&> o grups d\'alt risc. Comprova si aquesta vacuna es recomana en el teu cas.'),('vax_recommended_only','cs','Toto očkování je doporučeno pouze konkrétním oblastem v <COUNTRY_NAME&&> nebo vysoce rizikovým skupinám. Zkontrolujte si, zdali je tato vakcinace doporučena pro váš případ.	'),('vax_recommended_only','da','Denne vaccination er kun anbefalet for nogle specifikke områder i <COUNTRY_NAME&&> eller højrisikogrupper. Kontroller om denne vaccination er anbefalet i dit tilfælde. '),('vax_recommended_only','de','Diese Impfung wird nur für bestimmte Gebiete in  <COUNTRY_NAME&&> oder Gruppen mit hohem Risiko empfohlen. Überprüfen Sie, ob diese Impfung in Ihrem Fall empfohlen wird.'),('vax_recommended_only','el','Αυτός ο εμβολιασμός συνιστάται μόνο για ορισμένες περιοχές σε <COUNTRY_NAME&&> ή για ομάδες υψηλού κινδύνου. Ελέγξε εάν αυτός ο εμβολιασμός συνιστάται στην περίπτωσή σου.'),('vax_recommended_only','en','This vaccination is only recommended for some specific areas in <COUNTRY_NAME&&> or high risk groups. Check whether this vaccination is recommended in your case.'),('vax_recommended_only','es','Esta vacuna está recomendada únicamente en áreas específicas de <COUNTRY_NAME&&> o a grupos de alto riesgo. Verifica si esta vacuna está recomendada en tu caso.\n'),('vax_recommended_only','fa','این واکسن تنها برای برخی از مناطق خاص <&&COUNTRY_NAME> یا گروههای پر خطر توصیه می شود. ببینید آیا این واکسن برای شما توصیه می شود یا خیر.'),('vax_recommended_only','fi','Tätä rokoitetta suositellaan vain tietyillä alueilla maassa <COUNTRY_NAME&&> tai korkean riskin ryhmille. Tarkista suositellaanko rokotetta sinun kohdallasi.'),('vax_recommended_only','fr','Ce vaccin n\'est recommandée que pour certaines zones spécifiques <COUNTRY_NAME&&> ou groupes à haut risque. Vérifiez si ce vaccin est recommandée dans votre cas.'),('vax_recommended_only','gu','આ રસીકરણ માત્ર કેટલાક ચોક્કસ ક્ષેત્રો માટે ભલામણ કરવામાં આવે છે<દેશ_નામ&&> અથવા ઉચ્ચ જોખમ જૂથો તપાસ કરો કે આ કિસ્સામાં તમારા રસીકરણની ભલામણ કરવામાં આવે છે કે કેમ. '),('vax_recommended_only','he','חיסון זה מומלץ עבור אזורים מסוימים ב<&&COUNTRY_NAME> או בקבוצות סיכון גבוהות בלבד. בדוק אם חיסון זה מומלץ במקרה שלך.'),('vax_recommended_only','hi','यह टीका <COUNTRY_NAME &&> के कुछ विशिष्ट क्षेत्रों के लिए या उच्च जोखिम समूहों के लिए अनुशंसित है। पता करें कि क्या आपके लिए यह टीका अनुशंसित है या नहीं।'),('vax_recommended_only','hr','Cijepljenje se preporučuje samo za određena područja u <COUNTRY_NAME&&> ili za skupine s visokim rizikom. Provjerite preporučuje li se ovo cijepljenje u vašem slučaju.'),('vax_recommended_only','hu','Ez a védőoltás csak <COUNTRY_NAME&&> bizonyos területein javasolt vagy magas kockázatú csoportok esetén. Ellenőrizze, hogy ez az oltás ajánlott-e az Ön esetében.'),('vax_recommended_only','it','Questa vaccinazione è raccomandata solo per alcune aree specifiche in <COUNTRY_NAME&&> o gruppi ad alto rischio. Controlla se questa vaccinazione è raccomandata nel tuo caso.'),('vax_recommended_only','ja','この予防接種は、 <COUNTRY_NAME&&>の特定の知己または高リスクグループのみにお勧めです。このワクチン接種があなたに推奨されているかどうかを確認してください。'),('vax_recommended_only','ka','ಈ ಲಸಿಕೆ <COUNTRY_NAME&&> ದೇಶದ ಕೆಲವು ನಿರ್ದಿಷ್ಟ ಪ್ರದೇಶಗಳಿಗೆ ಅಥವಾ ಹೆಚ್ಚಿನ ಅಪಾಯ ಸಂಭವವಿರುವ ವರ್ಗಗಳಿಗೆ ಮಾತ್ರ ಸೂಚಿಸಲಾಗಿದೆ. ನಿಮಗೆ ಇದು ಅನ್ವಯವಾಗುತ್ತದೆಯೇ ಎಂದು ಪರಿಶೀಲಿಸಿ.'),('vax_recommended_only','ko','이 예방 접종은 일부 특정 지역에서만 권장됩니다. <COUNTRY_NAME&&> 또는 고위험군. 귀하의 경우이 백신 접종이 권장되는지 확인하십시오.'),('vax_recommended_only','ml','<COUNTRY_NAME&&>-ലെ ചില പ്രത്യേക പ്രദേശങ്ങൾക്കോ,  ഉയർന്ന അപകട സാദ്ധ്യതാ ഗ്രൂപ്പുകൾക്കോ മാത്രമാണ് ഈ പ്രതിരോധ കുത്തിവയ്പ്പ് ശുപാർശ ചെയ്തിട്ടിള്ളത്.  താങ്കളുടെ കേസിൽ ഇത് ശുപാർശ ചെയ്തിട്ടുണ്ടോയെന്ന് പരിശോധിക്കുക.'),('vax_recommended_only','mr','हे लसीकरण केवळ <COUNTRY_NAME&&> मधील काही विशिष्ट भागांसाठी किंवा उच्च जोखीम गटासाठी शिफारसित करण्यात आले आहे. आपल्या बाबतीत या लसीची शिफारस केली आहे का हे तपासा.'),('vax_recommended_only','ms','Vaksinasi ini hanya disyorkan untuk beberapa kawasan tertentu di <COUNTRY_NAME&&> atau untuk kumpulan berisiko tinggi. Periksa sama ada vaksinasi ini disyorkan untuk anda.'),('vax_recommended_only','nl','Deze vaccinatie wordt alleen aanbevolen voor een aantal specifieke gebieden in <COUNTRY_NAME&&> of groepen met een hoog risico. Controleer in jouw geval of deze vaccinatie wordt aanbevolen of niet.'),('vax_recommended_only','no','Denne vaksinen anbefales kun for enkelte spesifikke områder i <COUNTRY_NAME&&> eller høyrisikogrupper. Sjekk om denne vaksinen er anbefalt i ditt tilfelle.'),('vax_recommended_only','or','ଏହି ଟୀକାକରଣ କେବଳ <COUNTRY_NAME&&>ଦେଶର କିଛି ନିର୍ଦ୍ଧିଷ୍ଟ ଅଂଚଳ  କିମ୍ବା ଅଧିକ ଶଙ୍କା ଥିବା ଲୋକଙ୍କ ପାଇଁ ଉଦ୍ଧିଷ୍ଟ। ଏହା ଆପଣଙ୍କ ପାଇଁ ଉଦ୍ଧିଷ୍ଟ କି ନାହିଁ ଦେଖି ନିଅନ୍ତୁ।'),('vax_recommended_only','pl','To szczepienie jest zalecane tylko w niektórych określonych obszarach <COUNTRY_NAME&&> lub grupach wysokiego ryzyka. Sprawdź, czy to szczepienie jest zalecane w twoim przypadku.'),('vax_recommended_only','pt','Esta vacina somente é recomendada para algumas áreas específicas do <COUNTRY_NAME&&> ou em grupos de alto risco. Verifique se está vacina é recomendada no seu caso.'),('vax_recommended_only','ro','Acest vaccin este recomandat numai pentru anumite zone din <COUNTRY_NAME&&> sau pentru grupuri cu risc ridicat. Verificați dacă această vaccinare este recomandată în cazul dumneavoastră.'),('vax_recommended_only','ru','Эта прививка рекомендуется только для некоторых конкретных регионов <COUNTRY_NAME&&> или групп высокого риска. Узнайте, рекомендуется ли эта прививка в вашем случае.'),('vax_recommended_only','sk','Toto očkovanie je odporúčané iba pre niektoré konkrétne oblasti v krajine <COUNTRY_NAME&&> alebo skupiny s vysokým rizikom. Skontrolujte, či je toto očkovanie odporúčané aj vo vašom prípade.'),('vax_recommended_only','sl','To cepivo je priporočljivo samo za določena območja v državi <COUNTRY_NAME&&> ali skupine z visokim tveganjem. Preverite, ali je to cepivo priporočljivo tudi v vašem primeru.'),('vax_recommended_only','sv','Denna vaccination rekommenderas endast för vissa specifika områden i <COUNTRY_NAME&&> eller högriskgrupper. Kontrollera om denna vaccination rekommenderas i ditt fall.'),('vax_recommended_only','ta','இந்த தடுப்பூசி <COUNTRY_NAME&&> -இல் உள்ள குறிப்பிட்ட பகுதிகள் அல்லது உயர் அபாயக் குழுக்களுக்காக மட்டுமே பரிந்துரைக்கப்படுகிறது. உங்கள் வழக்கில் இந்த தடுப்பூசி பரிந்துரைக்கப்படுகிறதா என்று பார்க்கவும்.'),('vax_recommended_only','te','<COUNTRY_NAME&&> లోని ప్రత్యేకమైన ప్రాంతాల కోసం లేదా అధిక పీడిత గుంపులకు అనుగుణంగా టీకాలు సిఫారస్సు చేయబడ్డాయి. మీ కేసుకు కూడా ఈ టీకా సిఫారసు చేయబడినదో లేదో పరిశీలించండి.'),('vax_recommended_only','th','การฉีดวัคซีนนี้แนะนำเฉพาะบางพื้นที่ใน <COUNTRY_NAME&&> เท่านั้น หรือสำหรับกลุ่มผู้มีความเสี่ยงสูง กรุณาตรวจสอบว่าคุณควรได้รับการฉีดวัคซีนนี้หรือไม่ '),('vax_recommended_only','tr','Bu aşı sadece <COUNTRY_NAME&&>\'deki belirli bölgeler veya yüksek risk grupları için önerilmektedir. Sizin durumunuzda bu aşının önerilip önerilmediğini lütfen kontrol edin.'),('vax_recommended_only','uk','Ця вакцинація рекомендована лише для деяких окремих областей в <COUNTRY_NAME &&> або групах високого ризику. Перевірте, чи рекомендована ця вакцинація у вашому випадку.\n'),('vax_recommended_only','ur','اس ویکسینیشن کی سفارش بعض مخصوص علاقوں بمتعلق ملک <COUNTRY_NAME&&> کی جاتی ہے یا شدید پرخطر گروہوں کے لیے ایسا کیا جاتا ہے. پڑتال کریں کہ آیا آپ کے معاملے میں یہ ویکسیشن سفارش کردہ ہے.'),('vax_recommended_only','vi','Mũi tiêm phòng chỉ được khuyến cáo cho một số vùng đặc biệt ở <COUNTRY_NAME&&> hoặc nhóm có rủi ro cao. Kiểm tra xem mũi tiêm phòng này có khuyến cáo trong trường hợp của bạn không.'),('vax_recommended_only','zh','这种疫苗仅推荐用于<COUNTRY_NAME&&>的部分特定地区或高风险人群。请核实这种疫苗是否推荐用于您所属的情况。'),
